import React from 'react';
import Header from './components/Header/Header';
import Footer from './components/Footer/Footer';

function App() {
  return (
    <div className="App">
		<Header />
		<About />
		<Skills />
		<Portfolio />
		<Contact />
		<Footer />
	</div>
  );
}

export default App;
